import React from 'react'
import Link from "./Link"

const links = [
  {id:"1", link: "#", name: "Home", class: "current"},
  {id:"2", link: "#Search", name: "Search", class: "not"},
  {id:"3", link: "#History", name: "History", class: "not"},
  {id:"4", link: "#Contact", name: "Contact", class: "not"}]

export default function Footer( ) {

  return (
    links.map(link => {
      return <Link key = {link.id} link = {link}/>
    })
  )
}
